//import Matter from "matter-js"

class Scene extends React.Component {

  constructor(props) {
    super()
    this.state = {
      display: props.display ? "block" : "none",
      top:        50,
      height:     'calc(100% - 50px)',
      background: 'red',
      width:      '100vw',
      position:   'fixed'
    }  
  }

  
  
  render(){
    console.dir(this.state)
    return (
      <div style={this.state}>
  
      </div>   
    )  
  }
}

export default Scene;
